import { createApp } from 'vue'
import Vue from 'vue';
import Index from './Index.vue'
import router from './router.js';
import prismic from './prismic.js';
console.log(prismic.routes);
Vue.prototype.$cmsRoutes = prismic.routes;
let index = createApp(Index);

index.use(router);
index.mount('#app');
